css:
.nuclide-debugger-root {
  display: block;
  height: 100%;
}
.nuclide-debugger-root progress.starting {
  width: 100%;
  max-width: 400px;
  min-width: 400px;
}
.nuclide-debugger-root select.form-control {
  color: #aaaaaa;
  background-color: #43484d;
  border-color: rgba(0, 0, 0, 0.5);
  max-width: 400px;
}
.nuclide-debugger-root .control-bar {
  display: flex;
  flex-direction: row-reverse;
}
.nuclide-debugger-root .control-bar button {
  padding: 0;
  border: 0;
  margin: 0;
  background: transparent;
}
.nuclide-debugger-root-close-button {
  background: transparent;
  border: none;
  padding: 0;
  position: absolute;
  top: 2.5em;
  right: 0.5em;
  z-index: 1;
}
.nuclide-debugger-root .inspector {
  display: flex;
  position: absolute;
  flex-direction: column;
  width: 100%;
  height: 100%;
  min-width: 400px;
}
/*
Hack for flexbox + vertical scaling with webview shadow dom.
Use flexbox cross-axis stretch to fill the vertical space.
*/
.nuclide-debugger-webview {
  display: flex;
  flex-direction: row;
  align-children: stretch;
  align-items: stretch;
  flex: 1 0 auto;
}
.nuclide-debugger-webview::shadow object {
  flex: 1 0 auto;
  height: auto !important;
}
